parse = function(id) {
	document.getElementById('APitem').innerHTML = itemlinks[id]["name"];
	var kdkd = APitems[id]["5.11"]["NORMAL_5X5"]["kd"];
	var margin = {top: 20, right: 30, bottom: 30, left: 40},
		width = 960 - margin.left - margin.right,
		height = 500 - margin.top - margin.bottom;

	var x = d3.scale.linear()
		.domain([d3.min(kdkd, function(d) { return d; }), d3.max(kdkd, function(d) { return d; })])
		.range([0, width]);

	var y = d3.scale.linear()
		.domain([0, .5])
		.range([height, 0]);

	var xAxis = d3.svg.axis()
		.scale(x)
		.orient("bottom");

	var yAxis = d3.svg.axis()
		.scale(y)
		.orient("left")
		.tickFormat(d3.format("%"));

	var line = d3.svg.line()
		.x(function(d) { return x(d[0]); })
		.y(function(d) { return y(d[1]); });

	var histogram = d3.layout.histogram()
		.frequency(false)
		.bins(x.ticks(40));

	var svg = d3.select("#APitem").append("svg")
		.attr("width", width + margin.left + margin.right)
		.attr("height", height + margin.top + margin.bottom)
	  .append("g")
		.attr("transform", "translate(" + margin.left + "," + margin.top + ")");

	svg.append("g")
		.attr("class", "x axis")
		.attr("transform", "translate(0," + height + ")")
		.call(xAxis)
	  .append("text")
		.attr("class", "label")
		.attr("x", width)
		.attr("y", -6)
		.style("text-anchor", "end")
		.text("Time between Eruptions (min.)");

	svg.append("g")
		.attr("class", "y axis")
		.call(yAxis);
	
	
	var dataI = histogram(kdkd),
		  kde = kernelDensityEstimator(epanechnikovKernel(3), x.ticks(100));

	  svg.selectAll(".bar")
		  .data(dataI)
		.enter().insert("rect", ".axis")
		  .attr("class", "bar")
		  .style("fill", "#bbb")
		  .attr("x", function(d) { return x(d.x) + 1; })
		  .attr("y", function(d) { return y(d.y); })
		  .attr("width", x(dataI[0].dx + dataI[0].x) - x(dataI[0].x) - 1)
		  .attr("height", function(d) { return height - y(d.y); });

	  svg.append("path")
		  .datum(kde(kdkd))
		  .attr("class", "line")
		  .attr("d", line);

	function kernelDensityEstimator(kernel, x) {
	  return function(sample) {
		return x.map(function(x) {
		  return [x, d3.mean(sample, function(v) { return kernel(x - v); })];
		});
	  };
	}

	function epanechnikovKernel(scale) {
	  return function(u) {
		return Math.abs(u /= scale) <= 1 ? .75 * (1 - u * u) / scale : 0;
	  };
	}
};